import { combineReducers, configureStore } from '@reduxjs/toolkit';
import goodReducer from './slices/goodSlice';

const rootReduser = combineReducers({
  good: goodReduser,
});

export function setupStore() {
  return configureStore({
    reducer: rootReduser,
  });
}
